reated with the freshest seasonal ingredients from local farmers, you know our food is going to be amazing. But successful catering is more than that! Itâ€™s our personalized service that will ensure your event is exactly the way you want it â€“ from start to finish. Weâ€™re here for you!â€','madresLogo.jpg','','deleted'),(33,26,6,'12 Baskets Catering',11,0.00,0,1,'When owner John Bagge began Twelve Baskets Catering in 1976, eating and buying locally was simply his way of life. Once the local eating ethic became a selling point, the company didnâ€™t need to reinvent itself â€“ it has been offering local-food catering to Seattle and Bellevue for more than three decades. Adding flavor to philosophy, our team contributes decades of culinary expertise to Twelve Baskets Catering. Their commitment to delicious food is a significant addition to the companyâ€™s sustainability equation.\n\nhttp://twelvebasketscatering.com/','tb_logo22.jpg','','deleted'),(32,26,6,'eatdrink Catering',11,0.00,0,1,'eatdrink is not your everyday catering company. Locally sourced,\nnaturally inspired. We donâ€™t just caterâ€¦ we create opportunities for\nfolks like you to eat, drink, and take in the moment at your event.\nLet us prove it to you.\n\nhttp://www.eatdrink-catering.com/','logo%20%281%29.jpg','','deleted'),(31,26,6,'The Upper Crust',11,0.00,0,1,'In 1984, The Upper Crust Catering was founded out of a passion for people and a passion for food. We have catered thousands of weddings, corporate events, and parties throughout the Pacific Northwest. Specializing in Northwest, Vegetarian & Vegan fare, we also offer full-service catering including bartending, rentals, and various service-styles to match your needs. We value helpful communication, outstanding customer service, and community involvement through our partner non-profit, Urban Hands which provides 50,000 free meals to homeless. Contact us for more information or a custom quote at info@theuppercrustcatering.com or 206-783-1826!\n\n*U