?\n\n* Our Main Space, lined by a 1920\'s brick wall with huge west facing windows\n* Log Cabin room and Library (perfect for a bride and groom\'s room, respectively)\n* Tiki Lounge with built-in bar and China room with wall-mounted monitor\n* A large variety of lounge furniture, including couches, tables, chairs as well as additional in-house rentals\n* Optional downstairs studio and art gallery (an extra 1000SF of space, designed to look like a NYC loft)\n* 8-hour rental period with option to purchase overtime (up until 3am)\n* Access to some of the city\'s best vendors, from florists to salons to officiants\n* P/A system with iPod hook-ups\n* Microphone\n* Built-in screen and projector\n* Wireless Internet\n* Full kitchen with microwave, vintage gas range, dishwasher, refrigerator/freezer\n* Easy Loading and Unloading Area\n* One hour unrestricted access to space for wedding rehearsal\n* An on-site representative to make sure your event goes smoothly from beginning to end\n* Cleaning',168.00,'new'),(22,4,1,'Photo Studio',0,10,10,0,166,83,0,480,15,10080,0.00,60,'Photo Studio',43.00,'new'),(23,4,1,'Cocktail Gallery',0,10,10,0,166,83,0,480,15,10080,0.00,60,'Cocktail Gallery',43.00,'new'),(24,4,1,'test',0,10,10,0,1223,12,0,15,15,12,12.00,15,'test',12.00,'deleted'),(25,5,1,'Seattle Creative Arts Center (Entire Venue)',0,11,11,0,100,75,0,120,15,4320,0.00,30,'2000 sq ft. w/ Stage, White Space, 1 Private meeting room 200 sq ft. Kitchen with Refrigerator and Freezer. P.A. and Lighting systems, Mobile Bar, Coat Rack, Podium, Projector and White Screen, 2 - 8 ft tables, 4 â€“ 5 ft Rectangular Tables. 50 chairs.',175.00,'new'),(26,5,1,'Rehearsal Space',0,11,11,0,50,25,0,120,15,4320,0.00,30,'White Space\n\nShared Kitchen with Refrigerator and Freezer. P.A. and Lighting systems, Mobile Bar, Coat Rack, Podium, Projector and White Screen, 2 - 8 ft tables, 4 â€“ 5 ft Rectangular Tables.\n50 chairs.',25.00,'new'),(27,5,1,'Classes, Meeting or Workshops Room',0,11,11,0,25,10,0,120,1