 ~251 mixed seating & standing â€“ theatre style chairs.',500.00,'new'),(34,7,2,'Jeremy Smith',0,13,15,0,1,1,0,30,15,180,0.00,0,'As one of the Founders of InviteBIG, I am happy to answer any questions or concerns you may have about our company or products. Just schedule some time with me for a product demo, 1 on 1 support training, or just a chat. \n\nTo schedule a meeting, please view my availability calendar and select and day and time that works best for you. There is no cap on the amount of time you can book; however, up to an hour is standard. ',0.00,'new'),(35,7,1,'Jeremy Smith',0,13,15,0,1,1,0,60,15,240,0.00,0,'Select a time for us to meet to demo the InviteBIG platform. We recommend setting aside a minimum of an hour, but the demo and Q & A session should take less than the entire time.\n\nAll times are in Pacific Standard Time.',0.00,'deleted'),(36,9,1,'Big Picture (Entire Venue)',0,15,17,1,100,100,0,180,15,4320,0.00,60,'Seattle Theatre capacity 100/ Social capacity 100 Extra plush stadium seating\n\n*Studio grade acoustics\n*Jaw dropping surround sound system\n*Wireless microphone (no charge)\n*Ability to feature PowerPoint, XBOX, DVD, Blu-ray, CD, Beta, DV Cam, *mini DV (additional charges may apply for some equipment)\n*Wheel chair accessible ',500.00,'new'),(37,9,1,'Living Room',0,15,17,1,10,10,0,180,15,4320,0.00,30,'Say hello to comfort. Animal print couches, club chairs, deco accents and space to accommodate a white board make for a relaxed approach to getting business done. Features include: wireless internet (free) and monitor with and DVD/CD player',75.00,'new'),(38,9,1,'War Room',0,15,17,1,14,12,0,180,15,4320,0.00,30,'This is the &quote;Power Room&quote; where business builds business. The centerpiece is a gleaming teak conference table with seating for twelve. A high ceiling with dramatic draping softens the mood. Wireless internet and plenty of wall space for white boards and brainstorming notes allow you to get the job done. Appropriate for business meetings and private dinner parties.',75.00,'new'),(39,8,1,'Fremont Foundry (Entire Venue)',0,14,16,1,100,100,0,60,15,4320,0.00,60,'The birthplace of two of Seattle\'s most famous statues â€” Fremont\'s Lenin and Capitol Hill\'s Jimmy Hendrix. Once an artists hub, this venue now offers 11,000 square feet of naturally lit rooms, featuring 20-foot skylights, a spacious courtyard, art gallery, an expansive rooftop terrace, and a penthouse with sweeping views of Seattle.\n\nInterior accents of steel, natural wood and exposed concrete highlight the building\'s unconventional industrial ambiance. Ideal for corporate events, product rollouts, fashion shows, music events, photo sessions, weddings and private parties.',75.00,'new'),(40,10,1,' Medium Conference Room',0,16,18,0,12,12,0,60,15,4320,0.00,30,'Table for 10-12\n\nIncludes:\n\nProjector & 10\' Screen\n4\' x 8\' Whiteboard\nStereo system w/ Surround Sound\nElectronically Controlled Privacy Blinds (great for screenings)\nFree Wi-Fi\nAccess to Print/Copy/Fax Machine\nAccess to Kitchen (Microwave, Refrigerator/Freezer, Sink)',50.00,'deleted'),(41,10,1,' Medium Conference Room',0,16,18,0,12,12,0,60,15,4320,0.00,30,'Table for 10-12\n\nIncludes:\n\nProjector & 10\' Screen\n4\' x 8\' Whiteboard\nStereo system w/ Surround Sound\nElectronically Controlled Privacy Blinds (great for screenings)\nFree Wi-Fi\nAccess to Print/Copy/Fax Machine\nAccess to Kitchen (Microwave, Refrigerator/Freezer, Sink)',50.00,'deleted'),(42,10,1,' Medium Conference Room',0,16,18,0,12,12,0,60,15,4320,0.00,30,'Table for 10-12\n\nIncludes:\n\nProjector & 10\' Screen\n4\' x 8\' Whiteboard\nStereo system w/ Surround Sound\nElectronically Controlled Privacy Blinds (great for screenings)\nFree Wi-Fi\nAccess to Print/Copy/Fax Machine\nAccess to Kitchen (Microwave, Refrigerator/Freezer, Sink)',50.00,'deleted'),(43,10,1,'Mid-Wilshire Location',0,16,18,0,1000,1000,0,60,15,4320,0.00,0,'Mid-Wilshire location',0.00,'new'),(44,10,1,'Small Meeting Room',0,16,18,0,4,4,0,60,15,4320,0.00,30,'Meeting table for 4, enclosed for privacy\n\nIncludes:\n\nFree Wi-Fi\nWhiteboard Wall\nUse of Conference Call Phone\nAccess to Print/Copy/Fax Machine\nAccess to Kitchen (Microwave, Refrigerator/Freezer, Sink)',35.00,'new'),(45,10,1,'Medium Conference Room',0,16,18,0,12,12,0,15,15,4320,0.00,30,'Table for 10-12\n\nIncludes:\n\nProjector & 10\' Screen\n4\' x 8\' Whiteboard\nStereo system w/ Surround Sound\nElectronically Controlled Privacy Blinds (great for screenings)\nFree Wi-Fi\nAccess to Print/Copy/Fax Machine\nAccess to Kitchen (Microwave, Refrigerator/Freezer, Sink)',50.00,'deleted'),(46,10,1,'Medium Conference Room',0,16,18,0,12,12,0,60,15,4320,0.00,30,'Table for 10-12\n\nIncludes:\n\nProjector & 10\' Screen\n4\' x 8\' Whiteboard\nStereo system w/ Surround Sound\nElectronically Controlled Privacy Blinds (great for screenings)\nFree Wi-Fi\nAccess to Print/Copy/Fax Machine\nAccess to Kitchen (Microwave, Refrigerator/Freezer, Sink)',50.00,'new'),(47,11,1,'Central Cinema (Entire Venue)',0,17,19,0,120,120,0,180,15,4320,0.00,30,'Central Cinema seats 120 people. All seats and booths have tables.\nThe Lobby Bistro seats 24 in a wrap around banquette.\nCarpeted Stage with theatrical lighting and DMX distributed dimming.\nStand-up and wireless handheld microphones.\n12 channel audio snake from stage to control booth.\nHDMI hi-def video/audio feed directly from the stage.\nTheater Surround Sound System.\nModern DCP Digital Cinema Projection system.\nCozy brick and timber theater space in a 1929 building.\nLicensed Cocktail, Beer & Wine service in the Cinema and Bistro.m full of people having a good time.',200.00,'new'),(48,11,1,'central cinema',0,17,19,0,120,120,0,180,15,4320,0.00,30,'Central Cinema seats 120 people. All seats and booths have tables.\nThe Lobby Bistro seats 24 in a wrap around banquette.\nCarpeted Stage with theatrical lighting and DMX distributed dimming.\nStand-up and wireless handheld microphones.\n12 channel audio snake from stage to control booth.\nHDMI hi-def video/audio feed directly from the stage.\nTheater Surround Sound System.\nModern DCP Digital Cinema Projection system.\nCozy brick and timber theater space in a 1929 building.\nLicensed Cocktail, Beer & Wine service in the Cinema and Bistro.',200.00,'deleted'),(49,12,1,'University of the Pacific (Entire Venue)',0,19,20,0,50000,50000,0,480,15,10080,5000.00,360,'University of the Pacific\'s unique campus offers many beautiful locations to host your event and guarantee to make the event special for you and your guests. We have hosted a wide variety of events and we pride ourselves on our ability to adapt any one of our locations to meet our clients needs whether it is a concert or a political event.\n\nOn behalf of Conference and Event Services we invite you to explore the many options and event venues for your next special occasion. Come experience our friendly staff and hard working planners in coordinating, planning, and executing your next event.\n\n',10000.00,'new'),(50,12,1,'Morris Chapel',0,19,20,0,300,300,0,240,15,4320,200.00,120,'Morris Chapel can host a variety of events throughout the year for the Pacific students and alumni as well as the local community! With the beautiful stained glass windows and classic wooden pews, Morris Chapel will be the perfect location for your wedding and the ideal backdrop for photos. \n\nThe chapel will seat a maximum of 300 people.\n\nOn campus, we also offer several reception venue options. The intimate River Room is the perfect location for small engagement dinner, complete with an adjacent deck overlooking the Calaveras River. The newly remodeled Grace Covell Banquet Hall, conveniently located directly next to Morris Chapel, offers a midsize option perfect for a large but cozy reception. For a large scale celebration, The Grand Ballroom just may be the perfect setting. The pristine architecture paired with the adjoining patio and lawn offers a space that lives up to its name.\n\nNot far from Morris Chapel we host a variety of reception venues that can hold any size group and be suited to your every need. The beautiful architecture and distinct stained glass windows make this venue truly unique. Whatever your vision, the experienced Morris Chapel staff will be sure to make your perfect day their top priority.',500.00,'new'),(51,12,1,'Grace Covell Banquet Hall',0,19,20,0,500,250,0,240,15,4320,200.00,120,'The newly renovated Grace Covell Banquet Hall is a wonderful midsize option for your wedding. The main reception space boasts hanging touchier chandeliers and complete audio visual capabilities. Just off the main space are two adjoining patios, perfect for taking a fresh breath. Grace Covell is conveniently located just steps away from Morris Chapel, so your guests are only feet away from your celebration.\n\nThe Grace Covell Banquet Hall is also a great midsize option for your corporate event. In the past the space has been host to holiday parties, forums, meetings keynotes and various other corporate and social events. The capabilities and customization of the Grace Covell Banquet Hall provide a versatile space that is a great option for your next corporate event.\n\nThe Grace Covell Banquet Hall is 5,500 square feet and is equipped to accommodate 250 for meals or 500 theater style.',400.00,'new'),(52,12,1,'The Grand Ballroom',0,19,20,0,575,320,0,240,15,4320,200.00,120,'Housed within a new state of the art â€˜greenâ€™ building, the DeRosa University Centerâ€™s Grand Ballroom offers the perfect setting for your wedding soirÃ©e. The brilliant natural lighting is great for daytime spring receptions, while the customizable lighting also sets a prefect mood for evening receptions. The pristine architecture paired with the beautiful outdoor environment provide a space that lives up to its name.\n\nThe Grand Ballroom is a great setting for larger events such as holiday gatherings, galas and other receptions and will be sure to give your event the perfect edge. The Grand Ballroom is equipped with state-of-the-art audio visual equipment in addition to fully customizable atmospheric and theatrical lighting. For smaller events, The Grand Ballroom partitions via a retractable wall, also allowing for smaller parties to enjoy its beauty.\n\nThe room is 5,900 square feet can accommodate 320 for meals or 575 theater style.',500.00,'deleted'),(53,12,1,'The Grand Ballroom',0,19,20,0,575,320,0,240,15,4320,200.00,120,'Housed within a new state of the art â€˜greenâ€™ building, the DeRosa University Centerâ€™s Grand Ballroom offers the perfect setting for your wedding soirÃ©e. The brilliant natural lighting is great for daytime spring receptions, while the customizable lighting also sets a prefect mood for evening receptions. The pristine architecture paired with the beautiful outdoor environment provide a space that lives up to its name.\n\nThe Grand Ballroom is a great setting for larger events such as holiday gatherings, galas and other receptions and will be sure to give your event the perfect edge. The Grand Ballroom is equipped with state-of-the-art audio visual equipment in addition to fully customizable atmospheric and theatrical lighting. For smaller events, The Grand Ballroom partitions via a retractable wall, also allowing for smaller parties to enjoy its beauty.\n\nThe room is 5,900 square feet can accommodate 320 for meals or 575 theater style.',500.00,'new'),(54,12,1,'River Room',0,19,20,0,80,20,0,120,15,4320,50.00,60,'The intimate River Room is an ideal venue for a smaller gathering or reception. The modern architecture provides a unique sophistication, while the location offers optimal privacy, and just off of the reception space is an adjoining deck with views of the Calaveras River and Pacific\'s North Campus. \n\nThe River Room is sure to add a special touch to your event with its full audio capabilities and fully customizable lighting. In the past, the River Room has hosted mixers, private dinners, keynotes and a variety of other corporate events.\n\nThe River Room offers both table and booth seating that are customizable to your needs. The interior space seats up to 80 with an extra 20 seats on the adjoining deck space.',200.00,'new'),(55,12,1,'Regents Room',0,19,20,0,96,80,0,120,15,240,50.00,60,'Located in the heart of Pacific\'s campus, the Regents Room offers a simple, low-key reception venue option. Just through the manicured lawn and deep redwood deck, the reception space features ornate chandeliers and classic architecture. \n\nIn the past the Regents Room has hosted speakers, luncheons, private dinners, and a variety of other corporate functions.\n\nAdorned with portraits of Pacific\'s regents, the Regents room offers a classic space for an understated reception. The room is equipped to accommodate 80 for meals or 96 theatre style.',200.00,'new'),(56,12,1,'Reynolds Gallery',0,19,20,0,125,40,0,240,15,43200,150.00,120,'The Reynolds Gallery is located on Mendocino Avenue in Pacific\'s South Campus. This versatile space offers a unique venue that is perfect for catered receptions, mixers, and other corporate social events, and its modern architecture provides a dramatic backdrop to visiting art shows, which rotate on a monthly basis.\n\nThe Reynolds Gallery is the perfect venue, guaranteed to provide a unique experience that will be sure to impress your guests.\n\nThe Gallery is equipped to accommodate a standing reception of 125 and seated event of 40.\n\nDue to the nature of the exhibition scheduling, the Reynolds Gallery can only be booked six months in advance.',400.00,'new'),(57,12,1,'Pacific Theatre',0,19,20,0,183,183,0,120,15,480,150.00,60,'The Pacific Theatre is a state-of-the-art movie theater and lecture hall. The High Definition projection system has capability to screen presentations in both DVD and computer formats, and the venue\'s digital surround sound audio system, comparable to systems in larger movie theaters, is sure to impress your participant