(308,125,1,'Union Theatre (Entire Venue)',0,144,137,0,10,0,0,0,30,0,0.00,0,'The Union Theatre is a proscenium arch style venue with a large stage, house curtain, fly tower and refurbished auditorium with 385 seats.\n\nThe Union Theatre’s acoustics are sympathetic to untrained voices and the stage is not raked, making this a popular venue for student and amateur performances, with an emphasis on musicals and dance shows. The theatre’s deep forestage and audio visual facilities also make it ideal for corporate and conference presentations. Backstage, lighting, control and equipment are of a professional standard.\n\nThe Union Theatre is located on the ground floor of Union House, The University of Melbourne.\n\nPlease note that student theatre groups affiliated with Union House Theatre are given priority booking within the University of Melbourne Semester periods. Venue allocation for first semester occurs in October for the following year, while second semester allocation occurs in May of the current year.\n\nA trained theatre worker is allocated as safety officer for each theatre. This worker is there to assist in the smooth setup and running of a production. At an additional fee a lighting or sound operators can also be provided.',100.00,'new'),(309,126,1,'The Permanent (Entire Venue)',0,146,138,0,10,0,0,0,30,0,0.00,0,'The Permanent is a select heritage event venue available for private event bookings. The space is ideal for weddings, corporate cocktail and gala events, trade shows, conferences, and private parties. The venue is conveniently located in downtown Vancouver near the Waterfront and Stadium Skytrain Stations. There is also ample parking close by and hotel accommodations next door at the Victorian Hotel. \n\nNamed after the BC Permanent & Loan Company, which opened it’s doors in 1907, The Permanent has been completely renovated and restored to it’s historic glory. In 1935, the Bank of Canada called this venue home. We have kept the original vault door an