eurs Concertzaal (Entire Venue)',0,234,216,0,10,0,0,0,30,0,0.00,0,'Handelsbeurs Concertzaal is een creatief muziekhuis, gevestigd in een prachtig monument, dat een verscheiden waaier aan muziekuitingen presenteert en (co)produceert. Het is een huis dat zijn rol wil vervullen op lokaal, nationaal en internationaal niveau als een noodzakelijk muziekforum dat bruggen tussen verschillende muziekgenres wil bouwen en daarvoor een breed publiek wil enthousiasmeren. Het is een plek die actief wil inspelen op de diversiteit binnen de samenleving en waar muzikanten kunnen creëren en presenteren in de beste omstandigheden, omkaderd door een team van bevlogen medewerkers. De Handelsbeurs is een duurzame onderneming die aandacht heeft voor de uitdagingen waar de huidige samenleving voor staat.',100.00,'new'),(483,201,1,'Nibble Spaces (Entire Venue)',0,235,217,0,10,0,0,0,30,0,0.00,0,'this is a venue description let me see if this works',100.00,'new'),(484,202,1,'Valley room (Entire Venue)',0,236,218,0,10,0,0,0,30,0,0.00,0,'Large room, provided with a lot of things.\nBeautifuly decorated and fully equiped for your meetings, conferences or training sessions.\ncall for more information',100.00,'new'),(485,203,1,'Delta Athenaeum (Entire Venue)',0,237,219,0,10,0,0,0,30,0,0.00,0,'The Delta Athenaeum has been listed on the National Register of Historic Places as the Kansas City Athenaeum Club House since 1979. With three levels and 15,000 square feet of event space, the Grecian architectural building is well-preserved with most of its original features.\n\nThe main level ballroom/auditorium, with velvet-curtained stage and seating for up to 500 guests, is renowned for its magnificent chandeliers and two-story stained glass windows. Adjacent to the ballroom is the spacious grand foyer with custom-designed tile flooring, as well as two classic parlor rooms adorned with fireplaces and meeting space for 48 attendees.\n\nThe third-floor balcony music room overlooks the ballroom and has capacity of 150 guests. With a barrel-vault ceiling and sliding windowed-wall enclosure, the balcony room was acoustically commissioned as a concert hall for the Conservatory of Music. The third floor also features a bridal suite at the top of a red-carpeted stairway for an elegant wedding processional.\n\nThe ground level entrance on the first floor enhances the accessibility of a large dining area and multi-purpose meeting room and office space. An elaborate stone fireplace provides an impressive backdrop for receptions and assemblies in the dining area. The first floor is replete with an expansive commercial kitchen that has served as the home for many of Kansas City’s most popular caterers. Currently, the kitchen and ground floor event space are leased to TNK Children’s Foundation, which provides support for families of children with cancer and other blood diseases.\n\nRecent renovations to the first floor and main level of the Athenaeum have improved access for guests with disabilities.',100.00,'new'),(486,204,3,'Formation 1 (Entire Venue)',0,243,220,0,21,21,1,600,30,0,0.00,0,'Salle 1',650.00,'deleted'),(487,204,1,'Centre',0,243,220,0,21,21,1,240,15,1,0.00,0,'Centre',400.00,'new'),(488,204,1,'Salle 1',0,243,220,0,1,21,1,240,15,1,0.00,0,'salle',400.00,'new'),(489,204,1,'Salle 2',0,243,220,0,1,21,1,240,15,1,0.00,0,'salle',400.00,'new'),(490,204,1,'Salle 3',0,243,220,0,1,21,1,240,15,1,0.00,0,'salle',400.00,'new'),(491,205,1,'Frank\'s Pavilion (Entire Venue)',0,244,221,0,10,0,0,0,30,0,0.00,0,'Checkcheckcheck it out',100.00,'new'),(492,206,1,'Stadium (Entire Venue)',0,245,222,0,10,0,0,0,30,0,0.00,0,'Stadium Court',100.00,'new'),(493,207,1,'Hall5 (Entire Venue)',0,246,223,0,10,0,0,0,30,0,0.00,0,'Children Party',100.00,'new'),(494,208,1,'Norwalk Performing Arts Center (Entire Venue)',0,247,224,0,10,0,0,0,30,0,0.00,0,'A performing arts center for the students, families, residents and community of Norwalk, Iowa. Proudly serving the performers in all grades K-12, we are also 