sta ballroom on the first floor features 5,400 square feet of space with hickory hardwood floors, exquisite chandeliers, a grand staircase entrance, in-house sound system, and elegant restrooms designed to accommodate up to 650 guests. The ballroom can accommodate up to 448 guests in table seating and up to 600 guests in theater seating.\n\nThe 8,000 square foot second floor includes the Ashley Parlor for smaller events such as intimate chapel style weddings and smaller meetings or parties with up to 75 people, and the Lowndes Loft consists of 6,000 square feet of open space to accommodate larger events. The Ashley Parlor and Lowndes Loft may be utilized together, accommodating a maximum of 344 guests. The second floor also features a beautifully appointed bride’s room/ ladies’ parlor and separate groom’s room/ gentlemen’s parlor.\n\nTables, linens, and your choice of Champagne Chiavari chairs for elegant events or black padded chairs for more casual events are provided with room rentals to provide the complete setup for your perfect occasion. The Patterson has full handicap accessibility to both floors with an historic elevator, complete with a friendly attendant. The Patterson is surrounded by ample public parking, and valet parking is also available. Make your next event one to remember in the Lowndes Loft, the Val d’Osta ballroom, or the Ashley Parlor!\n\n',100.00,'new'),(503,212,1,'Val d’Osta ballroom',1,252,228,0,650,600,0,60,60,0,0.00,0,'The Val d’Osta ballroom on the first floor features 5,400 square feet of space with hickory hardwood floors, exquisite chandeliers, a grand staircase entrance, in-house sound system, and elegant restrooms designed to accommodate up to 650 guests. The ballroom can accommodate up to 448 guests in table seating and up to 600 guests in theater seating.',100.00,'new'),(504,212,1,'The Lowndes Loft',1,252,228,0,269,269,0,60,60,60,0.00,0,'The Lowndes Loft consists of 6,000 square feet of open space to accommodate larger events up to 