rofessional service to our guests, clients, partners and each other\n *Manage our business with accountability, integrity, and commitment to race &amp;amp;amp;amp;amp;amp;amp;amp; social justice\n *Foster a collaborative, trusting, and respectful workplace community\n *Provide opportunities for employee development\n *Model innovation, efficiency, and sustainability\n *Focus on operational excellence and fiscal strength\n *Steward a safe and welcoming place for all Commit to shaping our future and telling our story','','private','http://www.seattlecenter.com/','','','Seattle Center Foundation','305 Harrison Street, Seattle, WA 98109, USA','98109','Seattle','WA','USA','','','(206) 684-7200',0.09,'USD','',0.000,0.049,'','active'),(4,1424153001,1431029632,'America/Los_Angeles',2,2,NULL,'urban-light-studios-seattle','seattle-wa/bars-and-nightclubs/urban-light-studios-seattle','Urban Light Studios','The cure for the white box.\n\nInspired by the abundant character and versatility of a Hollywood back lot, Urban Light Studios is a photographer\'s playground. Rich with textures of vintage brick, concrete, warehouse windows, barnwood, fabrics and a variety of themed shooting rooms, you can now truly shoot around the world in one studio. Abundant available light, drive in access, a large kitchen and client area, and a log cabin green room complete the most unique studio in town. \n\nWe offer several studio options ranging from 700 to 4000 sf - each with independent character - to fit any size shoot and budget. \n\nOh, and a Dynalite strobe package is included complimentary with all rentals. \n\nUrban Light is committed to offering opportunities to both the veteran and up and coming photographer. If you are new to studio work, we\'re even happy to go over the equipment and some lighting concepts with you. We\'re a pro studio without the big attitude - whatever your needs, we will go the extra mile to make your shoot exceptional. ','','public','http://urbanlightstudios.com','',