h & adults each year around the city. We look forward to welcoming you for a tour!\n\nFAQ: https://docs.google.com/document/preview?id=1PbTdkUfVV_C9egscuIHsbtSAIvAyUtOyhXGzrwMJMAE','','private','http://fremontabbey.org/','','','Fremont Abbey','4272 Fremont Ave N, Seattle, WA 98103, USA','98103','Seattle','WA','USA','47.659185','-122.34968','(206) 414-8325',0.09,'USD','',0.000,0.049,'','active'),(7,1425345401,1426974675,'America/Los_Angeles',2,5,NULL,'invitebig-seattle','seattle-wa/fun-and-amusement-centers/invitebig-seattle','InviteBIG','Using state-of-the-art technology packed with user-friendly features, our event software is designed to revolutionize the way events are planned, managed and executed. We believe that bringing event organizers and venue staff together to collaborate is the most effective way to produce smooth, successful events. \n\nOur system offers event software and tools that are unique and perfect for today\'s mobile-minded market. If you are interested in learning more about how InviteBIG can assist you, please contact us or request a demo today.','','private','','','','InviteBIG, Inc.','2121 6th ave, Seattle, WA 98121, USA','98121','Seattle','WA','USA','47.6152474','-122.34974','2064523431',0.09,'USD','',0.000,0.049,'','active'),(8,1425445460,1437995919,'America/Los_Angeles',2,4,NULL,'fremont-foundry-seattle','seattle-wa/conference-and-meeting-rooms/fremont-foundry-seattle','Fremont Foundry','The birthplace of two of Seattle\'s most famous statues â€” Fremont\'s Lenin and Capitol Hill\'s Jimmy Hendrix. Once an artists hub, this venue now offers 11,000 square feet of naturally lit rooms, featuring 20-foot skylights, a spacious courtyard, art gallery, an expansive rooftop terrace, and a penthouse with sweeping views of Seattle.\n\nInterior accents of steel, natural wood and exposed concrete highlight the building\'s unconventional industrial ambiance. Ideal for corporate events, product rollouts, fashion shows, music events, photo sessions, weddings and private parties.','','public','http://www.fremontfoundry.com/','','','Fremont Foundry','154 North 35th Street, Seattle, WA 98103, USA','98103','Seattle','WA','USA','47.6518448','-122.35530','(206) 588-6981',0.09,'USD','',0.000,0.049,'','active'),(9,1426492421,1435703610,'America/Los_Angeles',2,3,NULL,'big-picture-theater-seattle','seattle-wa/concert-and-music-halls/big-picture-theater-seattle','Big Picture Theater','Big Picture is a unique, creative, sophisticated venue that is a memorable choice for meetings and parties. Here are just a few ideas of functions you might hold at Big Picture: corporate presentations, receptions, holiday parties, special birthday parties, morale events, retreats, board meetings, product launches, and private movie screenings. We are happy to put together a budget for the event you are looking to host.','','public','http://www.thebigpicture.net/','','','Big Picture','2505 First Avenue, Seattle, WA 98121, USA','98121','Seattle','WA','USA','47.6147712','-122.34921',' (206) 256-0566',0.09,'USD','',0.000,0.049,'','active'),(10,1426659396,1435945142,'America/Los_Angeles',2,4,NULL,'blankspaces-los-angeles','los-angeles-ca/conference-and-meeting-rooms/blankspaces-los-angeles','Blankspaces','Visit our sun lit coworking space in the heart of Silicon Beach in Santa Monica.','','public','http://www.blankspaces.com/','','','Blankspaces','5405 Wilshire Blvd',' 90036','Los Angeles','CA','USA','34.0626991','-118.34630','(323) 330-9505',0.09,'USD','',0.000,0.049,'','new'),(11,1427355617,1427359005,'America/Los_Angeles',2,2,NULL,'central-cinema-seattle','seattle-wa/bars-and-nightclubs/central-cinema-seattle','Central Cinema','Central Cinema is Seattleâ€™s only Dine-In Cinema. Located in the Central District neighborhood at 21st & Union. A place close to home for your total Date-Nite experience in one spot. See your favorite movies how they were meant to be seen, on a big screen, with big sound, in a room full of people having a good time.','',