nce','74100','Annemasse','AUVERGNE RHôNE-ALPES','France','46.187168','6.23635319999993','000000000000000',0.00,'CHF','',0.000,0.049,'','new'),(203,1469429459,1469435032,'America/Chicago',462,2,NULL,'delta-athenaeum-kansas-city',NULL,'Delta Athenaeum','The Delta Athenaeum has been listed on the National Register of Historic Places as the Kansas City Athenaeum Club House since 1979. With three levels and 15,000 square feet of event space, the Grecian architectural building is well-preserved with most of its original features.\n\nThe main level ballroom/auditorium, with velvet-curtained stage and seating for up to 500 guests, is renowned for its magnificent chandeliers and two-story stained glass windows. Adjacent to the ballroom is the spacious grand foyer with custom-designed tile flooring, as well as two classic parlor rooms adorned with fireplaces and meeting space for 48 attendees.\n\nThe third-floor balcony music room overlooks the ballroom and has capacity of 150 guests. With a barrel-vault ceiling and sliding windowed-wall enclosure, the balcony room was acoustically commissioned as a concert hall for the Conservatory of Music. The third floor also features a bridal suite at the top of a red-carpeted stairway for an elegant wedding processional.\n\nThe ground level entrance on the first floor enhances the accessibility of a large dining area and multi-purpose meeting room and office space. An elaborate stone fireplace provides an impressive backdrop for receptions and assemblies in the dining area. The first floor is replete with an expansive commercial kitchen that has served as the home for many of Kansas City’s most popular caterers. Currently, the kitchen and ground floor event space are leased to TNK Children’s Foundation, which provides support for families of children with cancer and other blood diseases.\n\nRecent renovations to the first floor and main level of the Athenaeum have improved access for guests with disabilities.','','public','','','','Delta Athenaeum','900 Linwood Blvd, Kansas City, MO 64109, USA','64109','Kansas City','MO','United States','39.0690384','-94.573779899999','816-800-4363',0.00,'USD','',0.000,0.049,'','new'),(204,1469449836,1469450982,'Europe/Zurich',463,4,NULL,'formation-1-geneva',NULL,'Centre formation','Salle 1','','public','','','','Formation 1','Geneva, Switzerland','','Geneva','GE','Switzerland','46.2043907','6.14315769999996','00412211111111',0.08,'CHF','',0.000,0.049,'','new'),(205,1469482761,1469482761,'America/Los_Angeles',464,2,NULL,'franks-pavilion-seattle',NULL,'Frank\'s Pavilion','Checkcheckcheck it out','','public','','','','Frank\'s Pavilion','1130 Broadway, Seattle, WA 98122, USA','98122','Seattle','WA','United States','47.6121856','-122.32025069999','867-908-9909',0.09,'USD','',0.000,0.049,'','new'),(206,1469592232,1469592413,'Australia/Brisbane',467,4,NULL,'stadium-buderim',NULL,'Stadium','Stadium Court','','public','','','','Stadium','Wises Rd, Buderim QLD 4556, Australia','4556','Buderim','QLD','Australia','-26.670869999999','153.082414400000','07 5477 3435',0.00,'AUD','',0.000,0.049,'','pending_review'),(207,1469626918,1469626918,'Europe/London',432,3,NULL,'hall5-glasgow',NULL,'Hall5','Children Party','','public','','','','Hall5','3 Byres Rd, Glasgow G11 5RD, UK','G11 5RD','Glasgow','SCOTLAND','United Kingdom','55.8706697','-4.2995390999999','0208 650 9249',0.00,'GBP','',0.000,0.049,'','new'),(208,1469842067,1469842067,'America/Chicago',472,3,NULL,'norwalk-performing-arts-center',NULL,'Norwalk Performing Arts Center','A performing arts center for the students, families, residents and community of Norwalk, Iowa. Proudly serving the performers in all grades K-12, we are also host to many exciting dance competitions and recitals, musical acts, and community gatherings.','','public','','','','Norwalk Performing Arts Center','1201 North Ave, Norwalk, IA 50211, USA','50211','Norwalk','IA','United States','41.4740725','-93.670536599999','515-981-3016',0.06,'USD','',0.000,0