ations. The recent renovation provides state of the art caterer’s kitchens on the first and second floors, allowing guests to use the caterer of their choice for alcohol and food.\n\nThe Val d’Osta ballroom on the first floor features 5,400 square feet of space with hickory hardwood floors, exquisite chandeliers, a grand staircase entrance, in-house sound system, and elegant restrooms designed to accommodate up to 650 guests. The ballroom can accommodate up to 448 guests in table seating and up to 600 guests in theater seating.\n\nThe 8,000 square foot second floor includes the Ashley Parlor for smaller events such as intimate chapel style weddings and smaller meetings or parties with up to 75 people, and the Lowndes Loft consists of 6,000 square feet of open space to accommodate larger events. The Ashley Parlor and Lowndes Loft may be utilized together, accommodating a maximum of 344 guests. The second floor also features a beautifully appointed bride’s room/ ladies’ parlor and separate groom’s room/ gentlemen’s parlor.\n\nTables, linens, and your choice of Champagne Chiavari chairs for elegant events or black padded chairs for more casual events are provided with room rentals to provide the complete setup for your perfect occasion. The Patterson has full handicap accessibility to both floors with an historic elevator, complete with a friendly attendant. The Patterson is surrounded by ample public parking, and valet parking is also available. Make your next event one to remember in the Lowndes Loft, the Val d’Osta ballroom, or the Ashley Parlor!','','public','','','','The Patterson Valdosta','101 NORTH PATTERSON STREET','31601','Valdosta','GA','USA','','','229.469.7704',0.00,'USD','',0.000,0.049,'','new'),(213,1471295488,1471300260,'America/Chicago',484,4,NULL,'catering-creations-thibodaux',NULL,'Catering Creations','A brief Summary of the things that we do. Fine dining, casual, buffett, breakfast, you name it! Sample, Sample, Sample.','','private','','','','Cateri